import React from 'react';
import { Ticket, MapPin, Calendar, Trash2, QrCode } from 'lucide-react';
import { useNavigate } from 'react-router-dom';

const MyEvents = ({ theme, events, onCancel }) => { 
  const navigate = useNavigate();
  const isDark = theme === 'dark';

  const styles = {
    container: {
      padding: '20px',
      backgroundColor: isDark ? '#0f172a' : '#fff',
      minHeight: '100vh',
      paddingBottom: '120px', // Extra space for bottom nav
      boxSizing: 'border-box'
    },
    title: {
      color: isDark ? '#fff' : '#1e293b',
      marginBottom: '25px',
      fontSize: '24px',
      fontWeight: 'bold'
    },
    card: {
      backgroundColor: isDark ? '#1e293b' : '#fff',
      borderRadius: '20px',
      padding: '20px',
      marginBottom: '20px',
      border: '2px dashed #5c5cfc',
      position: 'relative',
      display: 'flex',
      flexDirection: 'column',
      gap: '15px',
      boxShadow: '0 4px 6px rgba(0,0,0,0.05)'
    },
    cardHeader: {
      display: 'flex',
      gap: '15px',
      alignItems: 'flex-start'
    },
    iconBox: {
      backgroundColor: '#5c5cfc',
      color: '#fff',
      padding: '12px',
      borderRadius: '12px',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      height: 'fit-content'
    },
    eventTitle: {
      margin: '0 0 5px 0',
      color: isDark ? '#fff' : '#1e293b',
      fontSize: '18px',
      fontWeight: 'bold'
    },
    eventDate: {
      margin: 0,
      fontSize: '13px',
      color: '#94a3b8',
      display: 'flex',
      alignItems: 'center',
      gap: '5px',
      marginBottom: '4px'
    },
    eventLoc: {
      margin: 0,
      fontSize: '13px',
      color: '#5c5cfc',
      fontWeight: 'bold',
      display: 'flex',
      alignItems: 'center',
      gap: '5px'
    },
    // Button Container
    actionButtons: {
      display: 'flex',
      gap: '10px',
      marginTop: '5px'
    },
    viewBtn: {
      flex: 1, // Takes up half space
      backgroundColor: '#5c5cfc',
      color: '#fff',
      border: 'none',
      padding: '12px',
      borderRadius: '12px',
      fontWeight: 'bold',
      fontSize: '14px',
      cursor: 'pointer',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      gap: '8px'
    },
    cancelBtn: {
      flex: 1, // Takes up half space
      backgroundColor: '#fee2e2',
      color: '#ef4444',
      border: 'none',
      padding: '12px',
      borderRadius: '12px',
      fontWeight: 'bold',
      fontSize: '14px',
      cursor: 'pointer',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      gap: '8px'
    },
    emptyState: {
      textAlign: 'center',
      marginTop: '100px',
      color: '#94a3b8'
    },
    browseBtn: {
      backgroundColor: '#5c5cfc',
      color: '#fff',
      border: 'none',
      padding: '12px 24px',
      borderRadius: '12px',
      marginTop: '15px',
      fontWeight: 'bold',
      cursor: 'pointer'
    }
  };

  const handleCancelClick = (eventId) => {
    if (window.confirm("Are you sure you want to cancel this registration?")) {
      onCancel(eventId);
    }
  };

  return (
    <div style={styles.container}>
      <h2 style={styles.title}>My Tickets</h2>

      {events.length > 0 ? (
        events.map(event => (
          <div key={event.id} style={styles.card}>
            {/* Card Content */}
            <div style={styles.cardHeader}>
              <div style={styles.iconBox}>
                <Ticket size={24} />
              </div>
              <div style={{ flex: 1 }}>
                <h3 style={styles.eventTitle}>{event.title}</h3>
                <p style={styles.eventDate}><Calendar size={12} /> {event.date}</p>
                <p style={styles.eventLoc}><MapPin size={12} /> {event.location}</p>
              </div>
            </div>

            {/* Action Buttons Row */}
            <div style={styles.actionButtons}>
              <button 
                style={styles.viewBtn} 
                onClick={() => navigate(`/ticket-confirmation/${event.id}`)}
              >
                <QrCode size={16} /> View Ticket
              </button>

              <button 
                style={styles.cancelBtn} 
                onClick={() => handleCancelClick(event.id)}
              >
                <Trash2 size={16} /> Cancel
              </button>
            </div>
          </div>
        ))
      ) : (
        <div style={styles.emptyState}>
          <Ticket size={64} style={{ marginBottom: '15px', opacity: 0.3 }} />
          <p style={{ fontSize: '18px' }}>No tickets yet</p>
          <button onClick={() => navigate('/events')} style={styles.browseBtn}>
            Browse Events
          </button>
        </div>
      )}
    </div>
  );
};

export default MyEvents;
